import React from 'react';

export default function Tile({value, isNew}){
  const cls = value === 0 ? 'tile empty' : `tile tile-${value} ${isNew ? 'new-tile' : ''}`;
  return (
    <div className={cls}>
      {value !==0 ? <div className="tile-inner">{value}</div> : null}
    </div>
  );
}
